import React from "react";

const Agree = ({state, onChange, changeFlow}) => {
    const handleChangeCheckbox1 = (e) => {
        onChange({agree1: e.target.checked})
    }

    const handleChangeCheckbox2 = (e) => {
        const isChecked = e.target.checked
        onChange({agree2: isChecked})
        if(!isChecked){
            changeFlow(['hello', 'phone', 'hello'])
        }
    }
    return <>
            <br />
        <label>
            Zgoda 1:
            <input type={"checkbox"} onChange={handleChangeCheckbox1}/>
        </label>
            <br />
        <label>Zgoda 2:
            <input type={"checkbox"} onChange={handleChangeCheckbox2}/>
        </label>
    </>
}

export default Agree
